let currentInput = '0';
let operator = null;
let previousInput = null;

function updateDisplay() {
  document.getElementById('display').textContent = currentInput;
}

function appendNumber(num) {
  if (currentInput === '0' || currentInput === 'Error') {
    currentInput = num;
  } else {
    currentInput += num;
  }
  updateDisplay();
}

function appendOperator(op) {
  if (previousInput === null) {
    previousInput = currentInput;
    operator = op;
    currentInput = '0';
  } else {
    calculate();
    operator = op;
  }
}

function calculate() {
  if (previousInput === null || operator === null) return;

  const prev = parseFloat(previousInput);
  const current = parseFloat(currentInput);
  let result;

  switch(operator) {
    case '+': result = prev + current; break;
    case '-': result = prev - current; break;
    case '*': result = prev * current; break;
    case '/':
      result = current === 0 ? 'Error' : prev / current;
      break;
    default: return;
  }

  currentInput = result.toString();
  operator = null;
  previousInput = null;
  updateDisplay();
}

function clearDisplay() {
  currentInput = '0';
  operator = null;
  previousInput = null;
  updateDisplay();
}

function deleteChar() {
  currentInput = currentInput.length > 1 ?
    currentInput.slice(0, -1) : '0';
  updateDisplay();
}

// Form Validation Logic
const form = document.getElementById('validatorForm');
const nameInput = document.getElementById('name');
const emailInput = document.getElementById('email');
const phoneInput = document.getElementById('phone');
const passwordInput = document.getElementById('password');

function validateName() {
  const name = nameInput.value.trim();
  const error = document.getElementById('nameError');

  if (name.length < 2) {
    error.textContent = 'Name must be at least 2 characters';
    nameInput.classList.add('invalid');
    nameInput.classList.remove('valid');
    return false;
  }

  error.textContent = '';
  nameInput.classList.add('valid');
  nameInput.classList.remove('invalid');
  return true;
}

function validateEmail() {
  const email = emailInput.value.trim();
  const error = document.getElementById('emailError');
  const regex = /^[^\\s@]+@[^\\s@]+\\.[^\\s@]+$/;

  if (!regex.test(email)) {
    error.textContent = 'Please enter a valid email';
    emailInput.classList.add('invalid');
    emailInput.classList.remove('valid');
    return false;
  }

  error.textContent = '';
  emailInput.classList.add('valid');
  emailInput.classList.remove('invalid');
  return true;
}

function validatePhone() {
  const phone = phoneInput.value.trim();
  const error = document.getElementById('phoneError');
  const regex = /^[\\d\\s+-]+$/;

  if (!regex.test(phone) || phone.length < 10) {
    error.textContent = 'Please enter a valid phone number';
    phoneInput.classList.add('invalid');
    phoneInput.classList.remove('valid');
    return false;
  }

  error.textContent = '';
  phoneInput.classList.add('valid');
  phoneInput.classList.remove('invalid');
  return true;
}

function validatePassword() {
  const password = passwordInput.value;
  const error = document.getElementById('passwordError');
  const strengthBar = document.getElementById('strengthBar');

  let strength = 0;
  if (password.length >= 8) strength++;
  if (/[a-z]/.test(password)) strength++;
  if (/[A-Z]/.test(password)) strength++;
  if (/[0-9]/.test(password)) strength++;
  if (/[^a-zA-Z0-9]/.test(password)) strength++;

  const colors = ['#ef4444', '#f59e0b', '#eab308', '#84cc16', '#10b981'];
  const widths = ['20%', '40%', '60%', '80%', '100%'];

  strengthBar.style.width = widths[strength - 1] || '0';
  strengthBar.style.backgroundColor = colors[strength - 1] || 'transparent';

  if (password.length < 8) {
    error.textContent = 'Password must be at least 8 characters';
    passwordInput.classList.add('invalid');
    passwordInput.classList.remove('valid');
    return false;
  }

  error.textContent = '';
  passwordInput.classList.add('valid');
  passwordInput.classList.remove('invalid');
  return true;
}

// Real-time validation
